import { Avatar, Button, Card } from "antd";

const UserProfile = () => {
  return (
    <>
      <Card
        actions={[
          <div key="twit">
            twit
            <br />0
          </div>,
          <div key="followings">
            followings
            <br />0
          </div>,
          <div key="followers">
            followers
            <br />0
          </div>,
        ]}
      >
        <Card.Meta title="Hyoil" avatar={<Avatar>H</Avatar>}></Card.Meta>
        <Button>LogOut</Button>
      </Card>
    </>
  );
};

export default UserProfile;
